import React from 'react';
import './App.css';
import { useState, useEffect } from "react";

interface Article {
  id: number;
  title: string;
  description: String;
}

function App() {

  const [articles, setArticles] = useState([])

  useEffect(() => {
    fetch('http://127.0.0.1:8000/api/articles', {
      'method':'GET',
      headers: {
        'Content-Type':'application/json',
        'Authorization':'Token 90967bf73a23b66a6f1cc9fa584a9da33ff4aaad'
      }
    })
    .then(resp => resp.json())
    .then(resp => setArticles(resp))
    .catch(error => console.log(error))
  }, [])

  return (
    <div className="App">
      <h3>Django And ReactTS Blog App</h3>

      {articles.map((article: Article) => {
        return (
        <div key={article.id}>
          <h2>{article.title}</h2>
          <p>{article.description}</p>
        </div>
        )
      })}

    </div>
  );
}

export default App;
